import React from 'react';
import { Link } from 'react-router-dom';
import "./Navbar.css"

const Navbar = () => {
    return (
        <nav className="navbar">
            <div className="navMenu">
                <ul>
                    <li>
                        <Link to="/">HOME</Link>
                    </li>
                </ul>
            </div>
        </nav>

    )
}

export default Navbar;
